def interpret(code):
    ret = None
    counting_m = True
    m = 0
    array = [0]
    pointerLocation = 0
    i = 0
    c = 0
    while i < len(code):
        if counting_m:
            m += 1
        if code[i] == '<':
            if pointerLocation > 0:
                pointerLocation -= 1
        elif code[i] == '>':
            pointerLocation += 1
            if len(array) <= pointerLocation:
                array.append(0)
        elif code[i] == '+':
            array[pointerLocation] = (array[pointerLocation] + 1) % 256
        elif code[i] == '-':
            if pointerLocation == 1:
                counting_m = False
            array[pointerLocation] = (array[pointerLocation] - 1) % 256
        elif code[i] == '.':
            ret = chr(array[pointerLocation])
            pass
        elif code[i] == ',':
            array[pointerLocation] = input.pop(0)
        elif code[i] == '[':
            if array[pointerLocation] == 0:
                open_braces = 1
                while open_braces > 0:
                    i += 1
                    if code[i] == '[':
                        open_braces += 1
                    elif code[i] == ']':
                        open_braces -= 1
        elif code[i] == ']':
            open_braces = 1
            while open_braces > 0:
                i -= 1
                if code[i] == '[':
                    open_braces -= 1
                elif code[i] == ']':
                    open_braces += 1
            i -= 1
        i += 1
    # return array
    return m


